import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
    gridContainer: {
        borderRadius: 15,
        margin: '30px 0',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '10px 50px',
        backgroundColor: '#000022',
  },
}))
